import React from 'react';
import { Link } from 'react-router-dom';

const Menu = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/dashboard/students">Students</Link></li>
        <li><Link to="/dashboard/parents">Parents</Link></li>
        {/* Add more links as needed */}
      </ul>
    </nav>
  );
};

export default Menu;
